The CPU is composed of 8 different "registers". Registers are responsible for holding on to little pieces of data that the CPU can manipulate when it executes various instructions. The Game Boy's CPU is an 8-Bit CPU, meaning that each of its registers can hold 8 bits (a.k.a 1 byte) of data. The CPU has 8 different registers labled as "a", "b", "c", "d", "e", "f", "h", "l". Let's get started building our CPU by specing out the registers in code: struct Registers { a: u8, b: u8, c: u8, d: u8, e: u8, f: u8, h: u8, l: u8,
} We use the type u8 for our registers. u8 are 8-bit unsigned integers. For a refresher on how numbers are stored in computers, checkout the guide on numbers . While the CPU only has 8 bit registers, there are instructions that allow the game to read and write 16 bits (i.e. 2 bytes) at the same time (denoted as u16 in Rust - a 16 bit unsigned integer). Therefore, we'll need the ability to read an write these "virtual" 16 bit registers. These registers are refered to as "af" ("a" and "f" combined), "bc" ("b" and "c" combined), "de" ("d" and "e" combinded), and finally "hl" ("h" and "l" combined). Let's implement "bc": # struct Registers { a: u8, b: u8, c: u8, d: u8, e: u8, f: u8, h: u8, l: u8, }
impl Registers { fn get_bc(&self) -> u16 { (self.b as u16) << 8 | self.c as u16 } fn set_bc(&mut self, value: u16) { self.b = ((value & 0xFF00) >> 8) as u8; self.c = (value & 0xFF) as u8; }
} Here we see our first instance of "bit manipulation" through the use of four bitwise operators: ">>", "<<", "&", and "|". If you're unfamiliar with or feel a bit rusty using these types of operators, check out the guide on bit manipulation . For reading the "bc" register we first treat the "b" register as a u16 (this effectively just adds a byte of all 0s to the most significant position of the number). We then shift the "b" register 8 positions so that it's occupying the most signficant byte position. Finally, we bitwise OR the "c" register. The result is a two byte number with the contents of "b" in the most signficant byte position and the contents of "c" in the least signficant byte position.

