1111 0000
| |
└-+> Zero └-> Half Carry So while we could continue modeling our flags register as a simple 8-bit number (after all, that's all it is in reality), it might be less error prone to explicitly model the fact that the upper 4 bits (a.k.a the upper "nibble") has specific meaning and the lower 4 bits (a.k.a the lower "nibble") must always be zeros. For this reason we'll make a struct called the FlagsRegister : struct FlagsRegister { zero: bool, subtract: bool, half_carry: bool, carry: bool
} Since we might need to look at this register as an 8-bit number, we can implement some traits from the standard library that make this easy: # struct FlagsRegister {
# zero: bool,
# subtract: bool,
# half_carry: bool,
# carry: bool
# }
const ZERO_FLAG_BYTE_POSITION: u8 = 7;
const SUBTRACT_FLAG_BYTE_POSITION: u8 = 6;
const HALF_CARRY_FLAG_BYTE_POSITION: u8 = 5;
const CARRY_FLAG_BYTE_POSITION: u8 = 4; impl std::convert::From<FlagsRegister> for u8 { fn from(flag: FlagsRegister) -> u8 { (if flag.zero { 1 } else { 0 }) << ZERO_FLAG_BYTE_POSITION | (if flag.subtract { 1 } else { 0 }) << SUBTRACT_FLAG_BYTE_POSITION | (if flag.half_carry { 1 } else { 0 }) << HALF_CARRY_FLAG_BYTE_POSITION | (if flag.carry { 1 } else { 0 }) << CARRY_FLAG_BYTE_POSITION }
} impl std::convert::From<u8> for FlagsRegister { fn from(byte: u8) -> Self { let zero = ((byte >> ZERO_FLAG_BYTE_POSITION) & 0b1) != 0; let subtract = ((byte >> SUBTRACT_FLAG_BYTE_POSITION) & 0b1) != 0; let half_carry = ((byte >> HALF_CARRY_FLAG_BYTE_POSITION) & 0b1) != 0; let carry = ((byte >> CARRY_FLAG_BYTE_POSITION) & 0b1) != 0; FlagsRegister { zero, subtract, half_carry, carry } }
} The std::convert::From trait allows us to easily convert our FlagsRegister from a u8 and back. Now that we have our special FlagsRegister , we can replace the u8 in our Registers struct's f field. And that's it! We have all the functionality we need for our registers. Next we'll be looking at different instructions for manipulating the registers.

