There are four flags defined on the flags register: Zero: set to true if the result of the operation is equal to 0. Subtract: set to true if the operation was a subtraction. Carry: set to true if the operation resulted in an overflow. Half Carry: set to true if there is an overflow from the lower nibble (a.k.a the lower four bits) to the upper nibble (a.k.a the upper four bits). Let's take a look at some examples of what this means. In the following diagram, we have the byte 143 in binary (0b1000_1111). We then add 0b1 to the number. Notice how the 1 from the lower nibble is carried to the upper nibble. You should already be familiar with carries from elemetry arithmetic. Whenever there's not enough room for a number in a particular digit's place, we carry over to the next digits place. lower nibble lower nibble ┌--┐ ┌--┐ 1000 1111 + 1 == 1001 0000 └--┘ └--┘
upper nibble upper nibble If this happens when adding our values, we set the half_carry flag to true. We can test for this by masking out the upper nibble of both the A register and the value we're adding and testing if this value is greater than 0xF. So let's take a look at the code: # struct FlagsRegister { zero: bool, subtract: bool, half_carry: bool, carry: bool }
# struct Registers { a: u8, f: FlagsRegister }
# struct CPU { registers: Registers }
impl CPU { fn add(&mut self, value: u8) -> u8 { let (new_value, did_overflow) = self.registers.a.overflowing_add(value); self.registers.f.zero = new_value == 0; self.registers.f.subtract = false; self.registers.f.carry = did_overflow; // Half Carry is set if adding the lower nibbles of the value and register A // together result in a value bigger than 0xF. If the result is larger than 0xF // than the addition caused a carry from the lower nibble to the upper nibble. self.registers.f.half_carry = (self.registers.a & 0xF) + (value & 0xF) > 0xF; new_value }
}

