Along with the register data, our CPU also holds on to a 16-bit number called the progam counter (often abbreviated as PC) which tells us which instruction the Game Boy is currently executing. This 16-bit number is capable of addressing of the of 0xFFFF numbers that live in memory. In fact, when we talk about the memory array we don't usually use the term "index", but instead the term "address". Let's add a program counter to our CPU as well as memory that we can address from the CPU. # struct Registers {}
struct CPU { registers: Registers, pc: u16, bus: MemoryBus,
} struct MemoryBus { memory: [u8; 0xFFFF]
} impl MemoryBus { fn read_byte(&self, address: u16) -> u8 { self.memory[address as usize] }
} We now have a program counter that can tell us at which address in memory the currently executing instruction is. We won't talk much more about the contents of memory or where certain things in memory live until later in the book. For now, you should just picture memory as a large array that we can read from. Now we'll need to actually add the method to the CPU that uses the program counter to read the instruction from memory and execute it. The full set of steps is as follows: Use the program counter to read the instruction byte from memory. Translate the byte to one of the instances of the Instruction enum If we can successfully translate the instruction call our execute method else panic which now returns the next program counter Set this next program counter on our CPU # enum Instruction { }
