The process we've laid out for how instructions get executed is true for roughly half of the total instructions the Game Boy can perform. The other half of instructions work the same way except that instead of being identified by a single byte they're first indentified by a prefix byte. This prefix byte tells the CPU, "Hey! The next instruction byte you read shouldn't be interpreted as a normal instruction, but rather as a prefix instruction". This prefix byte is the number "0xCB". So, we'll need to add logic that first checks to see if the byte we read from memory is 0xCB. If it is, we then need to read one more byte and interpret this byte as an "prefix instruction". For example, if we read 0xCB from memory, we know that we're going to be decoding a prefix instruction. We then read another byte. If that byte is, say, 0xB4, we should not interpret this as OR with H as the target like we normally would but rather as a RES instruction with the 6th bit of the H register as the target. Again we can use the instruction guide to help us know what a given byte should decode as. Let's put it in code! # enum IncDecTarget { BC }
# enum PrefixTarget { B }
# enum Instruction { INC(IncDecTarget), RLC(PrefixTarget) }
# struct CPU { pc: u16, bus: Bus }
# struct Bus {}
# impl Bus { fn read_byte(&self, a: u16) -> u8 { 0 } }
# impl CPU { fn execute(&self, i: Instruction) -> u16 { 0 } }
impl CPU { fn step(&mut self) { let mut instruction_byte = self.bus.read_byte(self.pc); let prefixed = instruction_byte == 0xCB; if prefixed { instruction_byte = self.bus.read_byte(self.pc + 1); } let next_pc = if let Some(instruction) = Instruction::from_byte(instruction_byte, prefixed) { self.execute(instruction) } else { let description = format!("0x{}{:x}", if prefixed { "cb" } else { "" }, instruction_byte); panic!("Unkown instruction found for: {}", description) }; self.pc = next_pc; }
} impl Instruction { fn from_byte(byte: u8, prefixed: bool) -> Option<Instruction> { if prefixed { Instruction::from_byte_prefixed(byte) } else { Instruction::from_byte_not_prefixed(byte) } } fn from_byte_prefixed(byte: u8) -> Option<Instruction> { match byte { 0x00 => Some(Instruction::RLC(PrefixTarget::B)), _ => /* TODO: Add mapping for rest of instructions */ None } } fn from_byte_not_prefixed(byte: u8) -> Option<Instruction> { match byte { 0x02 => Some(Instruction::INC(IncDecTarget::BC)), _ => /* TODO: Add mapping for rest of instructions */ None } }
} The amount the program counter goes forward after each step of execution is determined by how "wide" the instruction - i.e. how many bytes it takes to describe the instruction in its entirety. For simple instructions, this is one byte - the byte the uniquely identifies the instruction. So far all the instructions we've seen either are 1 or 2 bytes wide (prefix instructions are two bytes - the prefix and the instruction identifier - while the other instructions are only one 1 byte - just for indentifier). In the future we'll see other instructions which have "operands" or data the instruction needs to execute. These instructions can sometimes be even 3 bytes wide. However, the program counter doesn't have to go forward by a set amount. In fact, there are instructions that manipulate the program counter in arbitrary ways sometimes sending the program counter to somewhere far away from its previous location.

