The real power of computers are their ability to "make decisions" - i.e., do one thing given one condition and do another thing given another condition. At the hardware level this is usually implemented with "jumps" or the ability to change where in our program we are (as indicated by the program counter) based on certain conditions. In the case of the Game Boy's CPU these conditions are specificed by the flags register. For example, there is an instruction that says to "jump" (i.e., set the program counter) to a certain location if the flags register's zero flag is true. This gives the game a way to perform certain instructions and then change to different parts of the game code if the result of the instruction resulted in setting particular flags. Let's list out the types of jumps there: JP: Jump to a particular address dependent on one of the following conditions: the zero flag is true, the zero flag is flase, the carry flag is true, the carry flag is false, or always jump. JR: Jump a certain amount relative to the current program counter dependent on the same conditions above. JPI: Jump to the address stored in HI You can find the specifics of how these jump instructions work in the instruction guide . Implementation of jump is pretty trivial: # struct FlagsRegister { zero: bool, carry: bool }
# struct Registers { f: FlagsRegister }
# struct CPU { registers: Registers, bus: Bus, pc: u16 }
# struct Bus {}
# impl Bus { fn read_byte(&self, addr: u16) -> u8 { 0 } }
enum JumpTest { NotZero, Zero, NotCarry, Carry, Always
}
enum Instruction { JP(JumpTest),
} impl CPU { fn execute(&mut self, instruction: Instruction) -> u16 { match instruction { Instruction::JP(test) => { let jump_condition = match test { JumpTest::NotZero => !self.registers.f.zero, JumpTest::NotCarry => !self.registers.f.carry, JumpTest::Zero => self.registers.f.zero, JumpTest::Carry => self.registers.f.carry, JumpTest::Always => true }; self.jump(jump_condition) } _ => { /* TODO: support more instructions */ self.pc } } } fn jump(&self, should_jump: bool) -> u16 { if should_jump { // Gameboy is little endian so read pc + 2 as most significant bit // and pc + 1 as least significant bit let least_significant_byte = self.bus.read_byte(self.pc + 1) as u16; let most_significant_byte = self.bus.read_byte(self.pc + 2) as u16; (most_significant_byte << 8) | least_significant_byte } else { // If we don't jump we need to still move the program // counter forward by 3 since the jump instruction is // 3 bytes wide (1 byte for tag and 2 bytes for jump address) self.pc.wrapping_add(3) } }
} It's important to note that the address we jump to is located in the two bytes following the instruction identifier. As the comment in the code example explains, the Game Boy is little endian which means that when you have numbers that are larger than 1 byte, the least significant is stored first in memory and then the most significant byte. +-------------+-------------- +--------------+
| Instruction | Least Signif- | Most Signif-
| Identifier | icant Byte | icant Byte |
+-------------+-------------- +--------------+ We're now succesfully executing instructions that are stored in memory! We learned that the current executing instruction is kept track of by the program counter. We then read the instruction from memory and execute it, getting back our next program counter. With this, we were even able to add some new instructions that let the game conditionally control exactly where the next program counter will be. Next we'll look at bit closer at instructions that read and write to memory.

