} impl CPU { fn execute(&mut self, instruction: Instruction) -> u16 { match instruction { Instruction::LD(load_type) => { match load_type { LoadType::Byte(target, source) => { let source_value = match source { LoadByteSource::A => self.registers.a, LoadByteSource::D8 => self.read_next_byte(), LoadByteSource::HLI => self.bus.read_byte(self.registers.get_hl()), _ => { panic!("TODO: implement other sources") } }; match target { LoadByteTarget::A => self.registers.a = source_value, LoadByteTarget::HLI => self.bus.write_byte(self.registers.get_hl(), source_value), _ => { panic!("TODO: implement other targets") } }; match source { LoadByteSource::D8 => self.pc.wrapping_add(2), _ => self.pc.wrapping_add(1), } } _ => { panic!("TODO: implement other load types") } } } _ => { panic!("TODO: support more instructions") } } }
} For loads with a register as a source, we simply read the register's value. If the source is a D8 (meaning "direct 8 bit value"), the value is stored directly after the instruction, so we can simply call read_next_byte which reads the byte directly after the byte the program counter is currently pointing to. Lastly, if the source is HLI we use the value inside of the HL register as an address from which we read an 8 bit value from memory. The target is merely the reverse of the source (except that we can't have D8 as a target). If the target is a register, we write the source value into that register, and if the target is HLI we write to the address that is stored inside of the HL register. The use of the 16-bit registers BC , DE , and HL to store addresses is very common. Let's take a look at the other types of loads that there are: Word : just like the Byte type except with 16-bit values AFromIndirect : load the A register with the contents from a value from a memory location whose address is stored in some location IndirectFromA : load a memory location whose address is stored in some location with the contents of the A register AFromByteAddress : Just like AFromIndirect except the memory address is some address in the very last byte of memory. ByteAddressFromA : Just like IndirectFromA except the memory address is some address in the very last byte of memory. For more detail on these instructions checkout the instruction guide . These instructions have been for writing and writing to anywhere in memory, but there are a set of instructions that deal with a specific piece of memory called the stack. Let's take a look at what the stack is and the instructions that are used to manipulate the stack.

