Before we can look at the piece of memory in the Game Boy known as the stack, we need to have a good understanding of what a stack is more generally. A stack is a simple data structure that allows you to add values to it (a.k.a "push" values) and then get these values back (a.k.a pop them off the stack). The key thing to remember with a stack is that you pop items off the stack in reverse order from which you pushed the items on - i.e., if you pushed three items "A", "B", "C" on to a stack in that order, the order you will get them back when poping them off is "C", "B", "A". The Game Boy CPU has built in support for a stack like data structure in memory. This stack lives somewhere in memory (we'll talk about how it's location in memory is set in just a minute), and it holds on to 16 bit values. How is it built? First, the CPU has an additional 16-bit register on it that indicates the top of the stack. This register is called SP or stack pointer because it "points" to where the top of the stack is. Let's add this register to our CPU: # struct Registers {}
# struct MemoryBus {}
struct CPU { registers: Registers, pc: u16, sp: u16, bus: MemoryBus,
} We have a stack pointer now so we know where our stack is, but how do we push and pop from this stack? The Game Boy's CPU understands two insructions for doing just that. PUSH will write the contents of any 16-bit register into the stack and POP writes the head of stack into any 16-bit register. Here's what's actually happening when a PUSH is performed: Decrease the stack pointer by 1. Write the most significant byte of the 16 bit value into memory at the location the stack pointer is now pointing to Decrease the stack pointer by 1 again. Write the least significant byte of the 16 bit value into memory at the location the stack pointer is now pointing to Notice that the stack pointer is decresed by 1 and not increased. This is because the stack grows downward in memory. This is extra helpful since the normal place for the stack to live is at the very end of memory. In a later chapter we'll see that it's actually the Game Boy's boot ROM that sets the stack pointer to the very end of memory. Thus, when the stack grows it grows away from the end of memory towards the beginning of memory. Let's implement PUSH : # struct Registers { }
# impl Registers { fn get_bc(&self) -> u16 { 0 } }
# struct CPU { pc: u16, bus: Bus, sp: u16, registers: Registers }
# struct Bus {}
# impl Bus { fn write_byte(&self, addr: u16, value: u8) { } }
# enum Instruction { PUSH(StackTarget), }
# enum StackTarget { BC, DE }
impl CPU { fn execute(&mut self, instruction: Instruction) -> u16 { match instruction { Instruction::PUSH(target) => { let value = match target { StackTarget::BC => self.registers.get_bc(), _ => { panic!("TODO: support more targets") } }; self.push(value); self.pc.wrapping_add(1) } _ => { panic!("TODO: support more instructions") } } } fn push(&mut self, value: u16) { self.sp = self.sp.wrapping_sub(1); self.bus.write_byte(self.sp, ((value & 0xFF00) >> 8) as u8); self.sp = self.sp.wrapping_sub(1); self.bus.write_byte(self.sp, (value & 0xFF) as u8); }
} We can now push elements on to the stack. Here's what's actually happening when a PUSH is performed: Read the least significant byte of the 16 bit value from memory at the location the stack pointer is pointing to Increase the stack pointer by 1. Read the most significant byte of the 16 bit value from memory at the location the stack pointer is now pointing to Increase the stack pointer by 1 again. Return the value with the most and least significant byte combined together Let's write POP : # struct Registers { }
# impl Registers { fn set_bc(&self, value: u16) { } }
# struct CPU { pc: u16, bus: Bus, sp: u16, registers: Registers }
# struct Bus {}
# impl Bus { fn read_byte(&self, addr: u16) -> u8 { 0 } }
# enum Instruction { POP(StackTarget), }
# enum StackTarget { BC, DE }
impl CPU { fn execute(&mut self, instruction: Instruction) -> u16 { match instruction { Instruction::POP(target) => { let result = self.pop(); match target { StackTarget::BC => self.registers.set_bc(result), _ => { panic!("TODO: support more targets") } }; self.pc.wrapping_add(1) } _ => { panic!("TODO: support more instructions") } } } fn pop(&mut self) -> u16 { let lsb = self.bus.read_byte(self.sp) as u16; self.sp = self.sp.wrapping_add(1); let msb = self.bus.read_byte(self.sp) as u16; self.sp = self.sp.wrapping_add(1); (msb << 8) | lsb }
} And there we have it! We have a working stack that we can used. But what sort of things is the stack used for? One built in use for the stack is creating a "call" stack that allows the game to "call" functions and return from them. Let's see how that works.

